export default function Resume() {
    return (
        <div className='about'>
            <h1>Resume</h1>
            <ul>
                <li>Name : Abrahim Kaba</li>
                <li> Date of Birth : Dec 03, 1990</li>
                <li>Nationality : Liberian</li>
                <li>Health : Excellence</li>
                <li>Marital Status : Single</li>
                <li>Contact : 01084032320</li>
                <li>Email : kabaAbrahim@gmail.com</li>
                <li>Address : Seoul Dang Jang Gu Jang seong Bae KL Ro 23 gil</li>
            </ul>

        </div>
    );
}
